import React from 'react'
import Script from "react-inline-script"
 
export default class MarineTrafficMap extends React.Component {
  constructor(props) {
    super(props)
  }
 
  render() {
    return (
      <div id="some-content">
        <Script>
        	{<script type="text/javascript" src="http://www.marinetraffic.com/js/embed.js"></script>}
        </Script>
      </div>)
    }
}
